INSERT INTO `wp_posts` VALUES (122,1,'2025-06-25 16:12:50','2025-06-25 09:12:50','<h2>Contact</h2>				\n		<p>Make learning and teaching more effective with active participation and student collaboration</p>		\n					<h2>We are always open 24/7 for you.</h2>				\n					<!DOCTYPE html>\n<html>\n    <style>\n    form {\n       padding: 10px;\n    }\n    :placeholder {\n        color: rgba(10, 8, 59, 0.5);\n    }\n    label {\n        color: #0A083B;\n        font-family: Inter;\n        font-size: 16px;\n        line-height: 24px;\n        font-weight: 600;\n    }\n    input {\n        padding: 20px 25px;\n        margin: 10px 0 0px;\n        border: 2px solid #E8E7ED;\n        border-radius: 6px;\n    }\n    input:focus, textarea:focus {\n        outline: 0;\n    }\n    input[type=\"text\"],input[type=\"email\"] {\n         width: 100%;\n        font-family: Inter;\n        font-weight: 400;\n        font-size: 16px;\n        line-height: 19px;\n        color: rgba(10, 8, 59, 0.50);\n    }\n    textarea {\n        width: 100%;\n        height: 135px;\n        padding: 20px 25px;\n        margin: 10px 0 0px;\n        border: 2px solid #E8E7ED;\n        border-radius: 6px;\n        font-family: Inter;\n        font-weight: 400;\n        font-size: 16px;\n        line-height: 19px;\n    }\n    .form-button {\n        font-family: Inter;\n        font-weight: 600;\n        font-size: 16px;\n        line-height: 19px;\n        padding: 16px 34px;\n        color: #fff;\n        background-color: #1950D1;\n        border-radius: 33px;\n        cursor: pointer;\n        float: right;\n        margin-top: 40px;\n    }\n    .form-button:hover {\n        background-color: #175CFF;\n        transition: .6s;\n    }\n    @media (max-width:768px) {\n        input {\n        padding: 15px 15px;\n    }\n    input[type=\"text\"],input[type=\"email\"] {\n        font-size: 14px;\n        line-height: 19px;\n    }\n     textarea {\n        font-size: 14px;\n         padding: 15px 15px;\n         height: 100px;\n    }\n    }\n    </style>\n    <body>\n        <form action=\"/action_page.php\">\n            <label for=\"fname\">Name </label><br>\n            <input type=\"text\" name=\"fname\" id=\"fname\" value=\"\" placeholder=\"John Doe\">\n            <br><br>\n            <label for=\"email\">Email </label><br>\n            <input type=\"email\" name=\"email\" id=\"email\" value=\"\" placeholder=\"name@example.com\"> <br> <br>\n            <label for=\"fname\">Subject </label><br>\n            <input type=\"text\" name=\"fname\" id=\"fname\" value=\"\" placeholder=\"Subject\">\n            <br><br>\n            <label for=\"text\"> Description </label><br>\n            <textarea placeholder=\"Write your message\" rows=\"7\"></textarea>\n            <a href=\"#\">Send Message</a>\n        </form>\n    </body>\n</html>				\n					<h2>Call us</h2>				\n		<p>+1-492-4918-395</p><p>+14-394-409-591</p>		\n					<h2>Email us</h2>				\n		<p>info@mail.com</p><p>support@mail.com</p>		\n					<h2>Visit us</h2>				\n		<p>34 Madison Street,</p><p>NY, USA 10005</p>','Contact Us','','publish','closed','closed','','contact-us','','','2025-06-25 16:14:06','2025-06-25 09:14:06','',0,'http://localhost:10004/?page_id=122',0,'page','',0);
